import React, { Component } from "react"
import { BrowserRouter, BrowserRouter as Router, Redirect, Route, Switch } from 'react-router-dom'
import CheckCookie from "./checkCookie.js"

import Login from "./pages/access/Login.js"
import Frontpage from "./pages/frontpage/Frontpage.js"

class ProtectedRoute extends Component {
  render() {

    const hasCookie = CheckCookie()

    return (
      <Route>
        {
          hasCookie ?
            <Redirect to="/frontpage" /> :
            <Redirect to="/login" />
        }
      </Route>
    )
  }
}

export default class CustomRoutes extends Component {
  render() {
    return (
      <Switch>
        <Route path='/login' component={Login} />
        <ProtectedRoute path='/frontpage' component={Frontpage}/>
      </Switch>
    )
  }
}
